import React, { Component } from 'react'
import {Card} from 'antd'

export class NotesList extends Component {
    render() {
        return (
            <Card title="Card title" bordered={true} style={{ width: 300 }}>
                <p>Title</p>
                <p>Content</p>
            </Card>                                  
        )
    }
}
